import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Login from '../components/Login';
import { useNavigate } from 'react-router-dom';

function LoginRoute() {
  const navigate = useNavigate();

  const handleLogin = ({ username, password }) => {
    // Aquí puedes manejar la lógica de autenticación si es necesario
    // Por ejemplo, podrías enviar una solicitud al servidor para verificar las credenciales
    console.log('Login credentials:', username, password);
    // Redirigir al usuario a la página de gestión de alojamientos
    navigate('/gestion-de-alojamientos');
  };

  return (
    <>
      <Login onLogin={handleLogin} />
      <Footer />
    </>
  );
}

export default LoginRoute;
